import React, { Fragment } from "react";
import { Helmet, HelmetProvider } from "react-helmet-async";

//import Components
import Heading from "../Components/Heading";

import { Row, Col, Form, Button } from "react-bootstrap";

//Toast
import { toast } from "react-toastify";

//Custom Style
import "../Styles/signup.css";

function SignUp() {
  return (
    <Fragment>
      <HelmetProvider>
        <Helmet>
          <title> Sign Up & Log In | Zom - IN </title>
        </Helmet>
      </HelmetProvider>
      <div id="signUp" className="signUp">
        <Col sm={11} md={9} className="mx-auto text-center">
          <Row>
            <Col sm={12} md={6}>
              <>
                <Heading content="Log In Now!" />
                <Form>
                  <Col>
                    <input
                      type="email"
                      id="inputEmail"
                      placeholder="Email Address"
                      className={logEmailClasses}
                      onChange={logEmailChangeHandler}
                      onBlur={logEmailBlurHandler}
                      value={enteredLogEmail}
                    />
                    {dobInputHasError && (
                  <Form.Control.Feedback type="invalid">
                    Please enter a valid Email Address.
                  </Form.Control.Feedback>
                )}
                  </Col>
                </Form>
              </>
            </Col>
            <Col sm={12} md={6} className="divider">
              fvd
            </Col>
          </Row>
        </Col>
      </div>
    </Fragment>
  );
}

export default SignUp;
